package fr.openent.competences;

public final class ImgLevel {

    public static final String LEVEL_3 = "data:image/png;base64,";

    public static final String LEVEL_4 = "data:image/png;base64,";
    public static final String LEVEL_5 = "data:image/png;base64,";
    public static final String LEVEL_6 = "data:image/png;base64,";

    public static String getImgLevel(int level){
        String imgLevel = "";
        if(level == 3){
            imgLevel = LEVEL_3;
        }
        if(level == 4){
            imgLevel = LEVEL_4;
        }
        if(level == 5){
            imgLevel = LEVEL_5;
        }
        if(level == 6){
            imgLevel = LEVEL_6;
        }
        return imgLevel;
    }
}
